message:
🚨*Caminhoneiros, atenção!*🚨

É necessário estruturar as reinvindicações para que tenhamos objetivos concretos a alcançar. Sendo assim, abaixo seguem algumas sugestões para avaliação:

🇧🇷👨‍👩‍👧‍👦*Reinvindicações dos brasileiros*🇧🇷👨‍👩‍👧‍👦

- Renúncia imediata do ministro Alexandre de Moraes;
- Cassação do registro do Partido dos Trabalhadores e de todos os outros partidos políticos associados à entidade internacional Foro de São Paulo que possui ligações com o narcotráfico;
- Nova lei tornando inelegíveis todos os coligados, ligados, partidários e membros do Partido dos Trabalhadores (PT), e de todos os outros partidos ligados à entidade internacional Foro de São Paulo que possui ligações com o narcotráfico;
- Reversão de todos os atos jurídicos praticados em inquéritos ilegais e sigilosos;
- Revogação de todas as multas aplicadas no período de Outubro a Dezembro de 2022 nas rodovias federais e estaduais em função das manifestações constitucionais e pacíficas realizadas pelo povo;
- Desbloqueio de todas as contas bancárias de pessoas físicas e jurídicas associadas às manifestações constitucionais e pacíficas, e ressarcimento monetário pelos prejuízos causados no período de bloqueio;
- Renúncia dos seguintes ministros do STF por prevaricação, abuso de autoridade e lesa-pátria: Edson Fachin, Gilmar Mendes, Alexandre de Moraes, Luís Roberto Barroso, Luiz Fux, Ricardo Lewandowski e Dias Toffoli.
- Invalidação das eleições presidenciais do ano de 2022 por fraude comprovada;
- Impugnação da canditatura do condenado Luís Inácio Lula da Silva;
- Revogação da concessão da Rede Globo.

Lembrem-se, vocês são homens e mulheres, não são cães, portanto não aceitem as migalhas jogadas ao povo por aqueles que se julgam donos do poder. *O povo é o PODER CONSTITUINTE, O POVO É SOBERANO*, e agora estamos exercendo o nosso poder diretamente, através do nosso direito inalienável de desobediência civil e de manifestação pacífica!

Deus os abençoe. Rezem o Rosário!
